Android/GetStarted.html.body:
开始集成
须知

Android 4.0 及以上
Amazon OS 5.4 及以上
Flex-Feed ads 需 API version 16 及以上

集成SDK
请在Maven集成和Jar集成二选其一使用。建议使用Gradle Maven库形式集成
Maven集成
在 project-level build.gradle, 添加 maven URL：
allprojects {
  repositories {
    maven {
      url 'https://plugins.gradle.org/m2/'
    }
    maven {
      url 'https://vungle.bintray.com/vungle-android-beta'
    }
  }
}
在 app-level build.gradle 添加如下依赖：
buildscript {
  repositories {
    mavenCentral() // or jcenter()
    maven {
      url "https://plugins.gradle.org/m2/"
    }
  }
  dependencies {
    classpath "com.jfrog.bintray.gradle:gradle-bintray-plugin:1.8.4"
  }
}


dependencies { 
  // Vungle SDK
  implementation 'vungle-android-beta:publisher-sdk-android:6.4.8'

  // Either appcompat-v7 or support-v4 is need for SDK operation 
  // Either
  implementation 'com.android.support:appcompat-v7:27.1.1'
  // Or
  implementation 'com.android.support:support-v4:27.1.1'
}
Jar集成
如使用Gradle集成，请跳过该部分。直接查看初始化Vungle SDK部分。
下载SDK V6，解压缩放到工程libs文件夹下。
在 app-level build.gradle 添加如下依赖：
dependencies {
    // Vungle SDK
    compile files('libs/vungle-android-sdk-6.4.8.jar')

    // Required Third-party Dependencies
    implementation files('libs/converter-gson-2.5.0.jar')
    implementation files('libs/gson-2.8.2.jar')
    implementation files('libs/logging-interceptor-3.12.0.jar')
    implementation files('libs/okhttp-3.12.0.jar')
    implementation files('libs/okio-1.15.0.jar')
    implementation files('libs/retrofit-2.5.0.jar')
    implementation files('libs/VNG-moat-mobile-app-kit-2.5.1.jar') // JAR Integration only


 // Either appcompat-v7 or support-v4 is need for SDK operation 
 // Either
 implementation 'com.android.support:appcompat-v7:27.1.1'
    // Or
    compile 'com.android.support:support-v4:27.1.1'
}
