ProGuard
 # Vungle
-keep class com.vungle.warren.** { *; }
-dontwarn com.vungle.warren.error.VungleError$ErrorCode

-keep class com.vungle.warren.downloader.DownloadRequest
-dontwarn com.vungle.warren.downloader.DownloadRequest$Status

# Google
