-dontwarn com.google.android.gms.ads.identifier.**

# Moat SDK
-keep class com.moat.** { *; }
-dontwarn com.moat.**

# Retrofit
-dontwarn okio.**
-dontwarn retrofit2.Platform$Java8

-dontwarn org.codehaus.mojo.animal_sniffer.IgnoreJRERequirement

# JSR 305 annotations are for embedding nullability information.
-dontwarn javax.annotation.**

# A resource is loaded with a relative path so the package of this class must be preserved.
-keepnames class okhttp3.internal.publicsuffix.PublicSuffixDatabase

# Animal Sniffer compileOnly dependency to ensure APIs are compatible with older versions of Java.
-dontwarn org.codehaus.mojo.animal_sniffer.*

# OkHttp platform used only on JVM and when Conscrypt dependency is available.
-dontwarn okhttp3.internal.platform.ConscryptPlatform

## Retrofit2
# Retrofit does reflection on generic parameters. InnerClasses is required to use Signature and
# EnclosingMethod is required to use InnerClasses.
-keepattributes Signature, InnerClasses, EnclosingMethod

# Retrofit does reflection on method and parameter annotations.
-keepattributes RuntimeVisibleAnnotations, RuntimeVisibleParameterAnnotations

# Retain service method parameters when optimizing.
-keepclassmembers,allowshrinking,allowobfuscation interface * {
    @retrofit2.http.* ;
}

# Ignore annotation used for build tooling.
-dontwarn org.codehaus.mojo.animal_sniffer.IgnoreJRERequirement

# Ignore JSR 305 annotations for embedding nullability information.
-dontwarn javax.annotation.**

-dontwarn kotlin.reflect.jvm.internal.**
-keep class kotlin.reflect.jvm.internal.** { *; }

# Guarded by a NoClassDefFoundError try/catch and only used when on the classpath.
-dontwarn kotlin.Unit

# Top-level functions that can only be used by Kotlin.
-dontwarn retrofit2.KotlinExtensions

# With R8 full mode, it sees no subtypes of Retrofit interfaces since they are created with a Proxy
# and replaces all potential values with null. Explicitly keeping the interfaces prevents this.
-if interface * { @retrofit2.http.* ; }
-keep,allowobfuscation interface 
GDPR
《通用数据保护条例》(GDPR) 将于 5 月 25 日在欧盟生效。为了遵守 GDPR，Vungle提供了如下方法。
The consentMessageVersion indicates publisher controlled consent policy version to allow publisher getting consent again when GDPR policy changes by pooling users by the message version.
// Usage example of GDPR API
// Vungle.Consent.OPTED_IN 允许使用用户私有信息投放广告
// Vungle.Consent.OPTED_OUT 不允许使用用户私有信息投放广告
Vungle.updateConsentStatus(Vungle.Consent.OPTED_IN, “1.0.0”);
Vungle.updateConsentStatus(Vungle.Consent.OPTED_OUT, “1.0.0”);

// To find out what the user's current consent status is:
// This will return null if the GDPR Consent status has not been set
// Otherwise, it will return Vungle.Consent.OPTED_IN or Vungle.Consent.OPTED_OUT
Vungle.Consent currentStatus = Vungle.getConsentStatus();
String consentMessageVersion = Vungle.getConsentMessageVersion();

Android/Reward.html.body:
Reward 奖励广告
Vungle的奖励广告是全屏视频广告。在播放完毕广告后，会自动跳转到落地页。在落地页用户可点击跳转到商店下载广告应用或游戏。
请求广告
SDK发送广告请求，在服务器给填充后开始缓存视频广告素材。Placement Reference id传送门。
// Load Ad Implementation
if (Vungle.isInitialized()) {
    Vungle.loadAd("YOUR_REWARD_Placement_reference_id", new LoadAdCallback() {
        @Override
        public void onAdLoad(String placementReferenceId) { }

        @Override
        public void onError(String placementReferenceId, Throwable throwable) {
            // Load ad error occurred - throwable.getLocalizedMessage() contains error message
        }
    });
}
播放广告
if (Vungle.canPlayAd("YOUR_REWARD_Placement_reference_id")) {
    AdConfig adConfig = new AdConfig();
    // 静音播放
    // adConfig.setMuted(true); 
    // 自动控制广告方向
    // adConfig.setAutoRotate(true);

    // 开启Direct Download，该功能只存在特定版本6.3.23，请勿使用其他版本
    Map extras = new HashMap<>();
    extras.put("direct_download", true); 
    adConfig.setExtraSettings(extras);

    Vungle.playAd("YOUR_REWARD_Placement_reference_id", adConfig, new PlayAdCallback() {
        @Override
        public void onAdStart(String placementReferenceId) { }

        @Override
        public void onAdEnd(String placementReferenceId, boolean completed, boolean isCTAClicked) { }
            // 可以在此处开始请求下一条广告
        @Override
        public void onError(String placementReferenceId, Throwable throwable) {
            // Play ad error occurred - throwable.getLocalizedMessage() contains error message
        }
    });
}

